import React from "react";
import ReactDOM from "react-dom";
import header from "./Header";
import footer from "./Footer";
import note from "./Note";


function App(){
    return (
        <div>
            <header />
            <note />
            <footer />
            
        </div>
        
    );
}




export default App;
